head.script:
scwin.onpageload = function() {
	/* singleSeriseChart 설정 시작 */
    var options = { 
        startValue: "20000", 
        color: "990000",
        displayValue: "Check"
    };
    var options1 = { 
        color:"990000",
        font:"15", 
        bold:"1"
    };
    singleSeriseChart.setChartAttribute({Caption:"Test"});
    singleSeriseChart.addTrendLine(options);
    singleSeriseChart.applyStyle("font", "captionFont", options1, ["Caption","XAXISNAME"]);
    singleSeriseChart.draw();

    scwin.radio1_onchange = function() {
        var chartType = radio1.getValue();
        singleSeriseChart.changeType(chartType);
    };
    /* singleSeriseChart 설정 끝 */

    /* multiSeriseChart 설정 시작 */
    scwin.radio2_onchange = function() {
        var chartType = radio2.getValue();
        multiSeriseChart.changeType(chartType);
    };
    /* multiSeriseChart 설정 끝 */ 

    /* stackedChart 설정 시작 */
    scwin.radio3_onchange = function() {
        var chartType = radio3.getValue();
        stackedChart.changeType(chartType);
    };
    /* stackedChart 설정 시작 */

    /* combinationChart 설정 시작 */
    scwin.radio4_onchange = function() {
        var chartType = radio4.getValue();
        combinationChart.changeType(chartType);
        if(chartType == "MSCombi3D" || chartType == "MSCombi2D"){
            combinationChart.setChartColumnRef('data:dataList2','col1',"[['col2',{'id':'col3','seriesname':'Year New','renderas':'Area'},{'id':'col4','renderas':'Line'}]]");
        } else if( chartType == "MSColumnLine3D" ){
            combinationChart.setChartColumnRef('data:dataList2','col1',"[['col2','col3',{'id':'col4','renderas':'Line'}]]");
        } else if( chartType == "StackedColumn2DLine" || chartType == "StackedColumn3DLine"){
            combinationChart.setChartColumnRef('data:dataList2','col1',"[['col2','col3',{'id':'col4','renderas':'Line'}]]");
        } else if( chartType == "MSCombiDY2D" || chartType == "MSColumn3DLineDY" || chartType == "StackedColumn3DLineDY") {
            combinationChart.setChartColumnRef('data:dataList2','col1',"[['col2','col3',{'id':'col4','renderas':'Line','parentYAxis':'S'}]]");
        }
    };
    /* combinationChart 설정 끝 */
};
